import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          <div className="col-3">
            Left panel
          </div>
          <div className="col-6">
            Middle Panel
          </div>
          <div className="col-3">
            Right Panel
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
